import React from 'react'
import { Link } from 'react-router-dom'
import { Chip } from '@mui/material';

import NavbarStyle from "./NavbarStyle";

const Navbar = () => {
    return (
        <container style={NavbarStyle.container}>
            <h1 style={NavbarStyle.textTitle}>EducateETF</h1>
            <h2 style={NavbarStyle.textSubtitle}>Educate</h2>
            <h2 style={NavbarStyle.textSubtitle}>Invest</h2>
	        <Chip label="Dashboard" component={Link} to="/dashboard" />
        </container>
    )
}

export default Navbar
